import QuoteList from '../components/quotes/QuoteList'

const DUMMY_QUOTES = [
    {
        id: 'q1',
        author: 'Zaky',
        text: 'Learning React is Fun'
    },
    {
        id: 'q2',
        author: 'Abanoub',
        text: 'Learning React is Great'
    },
]

const AllQuotes = () => {
    return <QuoteList quotes={DUMMY_QUOTES} />
}

export default AllQuotes
